# Database initialization with comprehensive tables
def init_db():
    conn = sqlite3.connect('astrafabric.db')
    c = conn.cursor()
    
    # Customers table
    c.execute('''CREATE TABLE IF NOT EXISTS customers
                 (id INTEGER PRIMARY KEY AUTOINCREMENT,
                  email TEXT UNIQUE NOT NULL,
                  name TEXT NOT NULL,
                  company TEXT,
                  phone TEXT,
                  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                  last_login TIMESTAMP)''')
    
    # Subscriptions table
    c.execute('''CREATE TABLE IF NOT EXISTS subscriptions
                 (id INTEGER PRIMARY KEY AUTOINCREMENT,
                  customer_id INTEGER,
                  plan TEXT NOT NULL,
                  amount REAL NOT NULL,
                  currency TEXT DEFAULT 'USD',
                  status TEXT DEFAULT 'active',
                  payment_method TEXT,
                  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                  expires_at TIMESTAMP,
                  FOREIGN KEY (customer_id) REFERENCES customers (id))''')
    
    # Transactions table
    c.execute('''CREATE TABLE IF NOT EXISTS transactions
                 (id INTEGER PRIMARY KEY AUTOINCREMENT,
                  customer_id INTEGER,
                  transaction_id TEXT UNIQUE NOT NULL,
                  amount REAL NOT NULL,
                  currency TEXT,
                  payment_method TEXT,
                  gateway_response TEXT,
                  status TEXT DEFAULT 'pending',
                  verified BOOLEAN DEFAULT FALSE,
                  created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                  verified_at TIMESTAMP,
                  FOREIGN KEY (customer_id) REFERENCES customers (id))''')
    
    # Security monitoring data (REAL FEATURES)
    c.execute('''CREATE TABLE IF NOT EXISTS security_events
                 (id INTEGER PRIMARY KEY AUTOINCREMENT,
                  customer_id INTEGER,
                  event_type TEXT NOT NULL,
                  severity TEXT DEFAULT 'medium',
                  description TEXT,
                  source_ip TEXT,
                  detected_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                  resolved BOOLEAN DEFAULT FALSE,
                  FOREIGN KEY (customer_id) REFERENCES customers (id))''')
    
    # Vulnerability scans (REAL FEATURES)
    c.execute('''CREATE TABLE IF NOT EXISTS vulnerability_scans
                 (id INTEGER PRIMARY KEY AUTOINCREMENT,
                  customer_id INTEGER,
                  scan_type TEXT NOT NULL,
                  results TEXT,
                  critical_count INTEGER DEFAULT 0,
                  high_count INTEGER DEFAULT 0,
                  medium_count INTEGER DEFAULT 0,
                  low_count INTEGER DEFAULT 0,
                  scan_date TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                  FOREIGN KEY (customer_id) REFERENCES customers (id))''')
    
    # Reports generated (REAL FEATURES)
    c.execute('''CREATE TABLE IF NOT EXISTS security_reports
                 (id INTEGER PRIMARY KEY AUTOINCREMENT,
                  customer_id INTEGER,
                  report_type TEXT NOT NULL,
                  report_data TEXT,
                  generated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                  FOREIGN KEY (customer_id) REFERENCES customers (id))''')
    
    # Admin logs
    c.execute('''CREATE TABLE IF NOT EXISTS admin_logs
                 (id INTEGER PRIMARY KEY AUTOINCREMENT,
                  action TEXT NOT NULL,
                  details TEXT,
                  timestamp TIMESTAMP DEFAULT CURRENT_TIMESTAMP)''')
    
    conn.commit()
    conn.close()

# Initialize database
init_db()

# Real security monitoring functions
def generate_security_event(customer_id, event_type, description, severity='medium'):
    '''Generate real security monitoring events'''
    try:
        conn = sqlite3.connect('astrafabric.db')
        c = conn.cursor()
        c.execute('''INSERT INTO security_events 
                    (customer_id, event_type, severity, description, source_ip)
                    VALUES (?, ?, ?, ?, ?)''',
                 (customer_id, event_type, severity, description, request.remote_addr))
        conn.commit()
        conn.close()
        return True
    except Exception as e:
        logger.error(f"Error generating security event: {str(e)}")
        return False

