def generate_security_events_html(events):
    if not events:
        return '''
        <div style="padding: 20px; text-align: center; color: #38a169;">
            <p>✅ No recent security threats detected</p>
            <p>Your systems are secure and protected</p>
        </div>
        '''
    
    html = ""
    for event in events:
        severity_color = "#e53e3e" if event[3] == 'critical' else "#f56565" if event[3] == 'high' else "#4299e1"
        html += f'''
        <div style="padding: 15px; margin: 10px 0; background: rgba(10, 14, 26, 0.6); border-radius: 10px; border-left: 4px solid {severity_color};">
            <strong style="color: {severity_color};">{event[2].upper()}</strong>
            <p style="margin: 5px 0; color: #e2e8f0;">{event[4]}</p>
            <small style="color: #a0aec0;">Detected: {event[6]} | Severity: {event[3].title()}</small>
        </div>
        '''
    return html

